import React, {Component} from 'react'

function getData(URL) {
    fetch(URL)
    .then(function(response) {
      alert(response.headers.get('Content-Type')); 
      alert(response.status);

      return response.json();
     })
    .then(function(user) {
      alert(user.name);
    })
    .catch( alert );
}


export default getData
